import React, { useEffect, useState } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css'; // Ensure Bootstrap CSS is imported
import { ToastContainer, toast } from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';
import { Slide } from 'react-toastify';
import { Collapse, CardBody, Card } from 'reactstrap';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faChevronDown, faChevronUp } from '@fortawesome/free-solid-svg-icons';
import { Button, Form } from 'react-bootstrap';
import { useGlobalContext } from '../../GlobalContext';


function Hologram() {
    const [isOpenTrackOption, setisOpenTrackOption] = useState(false);
    const { trackOptions, setTrackOptions } = useGlobalContext();
    const toggle = () => setisOpenTrackOption(!isOpenTrackOption);

    const handleChange = (event) => {
        const { name, value } = event.target;
        setTrackOptions({ ...trackOptions, [name]: value });
    };

    return (
        <div>
            <div onClick={toggle} style={{ backgroundColor: "white", display: 'flex', justifyContent: 'space-between', borderTopLeftRadius: '10px', borderTopRightRadius: '10px', borderBottomLeftRadius: '0px', borderBottomRightRadius: '0px' }}>
                <div style={{ display: 'flex', alignItems: 'center' }}>
                    <div className='fs-5 fw-bold' style={{ margin: '0px', padding: '10px', color: "black" }}>
                        Track Option
                    </div>
                    
                    <div style={{
                        height: '10px',
                        width: '10px',
                        backgroundColor: trackOptions.isOnline ? 'green' : 'red',
                        borderRadius: '50%',
                        display: 'inline-block',
                        marginLeft: '5px'
                    }}>
                    </div>
                    
                    <div className='fs-5 fw-bold'>
                        <FontAwesomeIcon icon={isOpenTrackOption ? faChevronUp : faChevronDown} />
                    </div>
                </div>


            </div>
            <Collapse isOpen={isOpenTrackOption}>
                <Card style={{ borderBottomLeftRadius: '10px', borderBottomRightRadius: '10px', borderTopLeftRadius: '0px', borderTopRightRadius: '0px' }}>
                    <CardBody>
                        <div className="d-flex align-items-center">
                            <span className="me-3 fs-6 fw-bold" style={{ color: "black" }}>Recieve Stream</span>
                            <div className="form-check form-switch fs-5">
                                <input
                                    className="form-check-input"
                                    type="checkbox"
                                    role="switch"
                                    checked={trackOptions.receiveStream}
                                    onChange={(e) => setTrackOptions({ ...trackOptions, receiveStream: e.target.checked })}
                                />
                            </div>
                        </div>

                        <Form.Group className="mb-3 row fs-6 fw-bold">
                            <div className="col">
                                <Form.Label>Diameter</Form.Label>
                                <Form.Control
                                    name="diameter"
                                    type="number"
                                    value={trackOptions.diameter}
                                    onChange={handleChange}
                                />
                            </div>
                            <div className="col">
                                <Form.Label>Seperation</Form.Label>
                                <Form.Control
                                    name="seperation"
                                    type="number"
                                    value={trackOptions.seperation}
                                    onChange={handleChange}
                                />
                            </div>
                            <div className="col">
                                <Form.Label>Percentile</Form.Label>
                                <Form.Control
                                    name="percentile"
                                    type="number"
                                    value={trackOptions.percentile}
                                    onChange={handleChange}
                                />
                            </div>
                        </Form.Group>

                        <Form.Group className="mb-3 row fs-6 fw-bold">
                            <div className="col">
                                <Form.Label>Minmass</Form.Label>
                                <Form.Control
                                    name="minmass"
                                    type="number"
                                    value={trackOptions.minmass}
                                    onChange={handleChange}
                                />
                            </div>
                            <div className="col">
                                <Form.Label>Maxmass</Form.Label>
                                <Form.Control
                                    name="maxmass"
                                    type="number"
                                    value={trackOptions.maxmass}
                                    onChange={handleChange}
                                />
                            </div>
                            <div className="col">
                                <Form.Label>PixelThresh</Form.Label>
                                <Form.Control
                                    name="pixelThresh"
                                    type="number"
                                    value={trackOptions.pixelThresh}
                                    onChange={handleChange}
                                />
                            </div>
                        </Form.Group>

                        <Form.Group className="mb-3 row fs-6 fw-bold">
                            <div className="col">
                                <Form.Label>LShort</Form.Label>
                                <Form.Control
                                    name="lShort"
                                    type="number"
                                    value={trackOptions.bpShort}
                                    onChange={handleChange}
                                />
                            </div>
                            <div className="col">
                                <Form.Label>LLong</Form.Label>
                                <Form.Control
                                    name="lLong"
                                    type="number"
                                    value={trackOptions.bpLong}
                                    onChange={handleChange}
                                />
                            </div>
                            <div className="col">
                                <Form.Label>Refine</Form.Label>
                                <Form.Control
                                    name="refine"
                                    type="number"
                                    value={trackOptions.refine}
                                    onChange={handleChange}
                                />
                            </div>
                        </Form.Group>

                    </CardBody>
                </Card>
            </Collapse>
        </div>
    );
}

export default Hologram;
